(function(){Vue.component("convos-recover",{props:["user"],data:function(){return{email:localStorage.getItem("email")||""};},template:"<convos-not-logged-in :user=\"user\" screen=\"recover\">\n    <div class=\"row\">\n      <md-input :value.sync=\"email\" id=\"form_login_email\" type=\"email\">Your login email</md-input>\n    </div>\n    <div class=\"row\">\n      <div class=\"col s12\">\n        Forgot your password? Tell your Convos admin to run the command below,\n        and then send you the recovery link:\n        <pre class=\"stylish\">$ convos get /user/recover/{{email || &#39;your-email@example.com&#39;}}</pre>\n      </div>\n    </div>\n    <div class=\"row\">\n      <div class=\"col s12\">\n        <a class=\"btn waves-effect waves-light\" v-link.literal=\"#page:login\">Login</a>\n      </div>\n    </div>\n  </convos-not-logged-in>\n"})})();